#include <math.h>
#include <stdlib.h>
#include "AnalogDisplay.h"
#include "LineDrawer.h"
#include "../inc/ST7735.h"
#include "../inc/tm4c123gh6pm.h"

#define PI 3.14
const unsigned short clockFaceArray[];
const int pinX=62;
const int pinY=70;
const int hrArmLength=12;
const int minArmLength=18;
const int secArmLength=21;


//%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
//**********ST7735_drawClockFace()*********
//Draws Clock Face
void ST7735_DrawClockFace(void){
	ST7735_DrawBitmap(24,110,clockFaceArray,80,80);
}

//Needed for ST7735_drawAnalog
double prevAng[3]={1,0,0};
double prevPlot[6]={0,0,0,0,0,0};
//**********ST7735_drawAnalog**********
//input: time (as seconds)
//Converts input time to angles, gets the tip of the hour and minute hands
//Draws clock face
//Updates time by erasing previous values(stored in prevPlot {mnY, mnX, hrY, hrX})
//Draws with new values using ST7735_Draw4Lines in ST7735.h
void ST7735_DrawAnalog(int time){

	//- because CW, /60 to ignore second, +90 to start at 0
	double secAng = -(((time)%60)*6)+90;
	double minAng=-(((time/60)%60)*6)+90;//%60 bc only min
	double hrAng=-(((time/60)%(12*60))/2)+90;//%720 bc 12 hrs, 60min/hr, /2 bc 24 hr format
	
	//Cos&Sin require double
	double hrX = hrArmLength*cos((PI*hrAng)/180);
	double hrY = hrArmLength*sin((PI*hrAng)/180);
	
	double mnX = minArmLength*cos(PI*minAng/180);
	double mnY = minArmLength*sin(PI*minAng/180);
	
	double scX = secArmLength*cos(PI*secAng/180);
	double scY = secArmLength*sin(PI*secAng/180);
	
	
	//Initialize Clock
	if(!prevAng[2]){
		ST7735_DrawClockFace();
		prevAng[2]=1;
		prevPlot[0]=hrX;
		prevPlot[1]=hrY;
		prevPlot[2]=mnX;
		prevPlot[3]=mnY;
		prevPlot[4]=scX;
		prevPlot[5]=scY;
	}

	//Update Clock Face
	//Erase Sec
	ST7735_DrawLine(pinX, pinY, pinX+(int)prevPlot[4], pinY-(int)prevPlot[5], ST7735_BLACK);
	//Draw Sec
	ST7735_DrawLine(pinX, pinY, pinX+(int)scX, pinY-(int)scY, ST7735_GREEN);
	//Erase Min
	ST7735_Draw4Lines(pinX, pinY, pinX+(int)prevPlot[2], pinY-(int)prevPlot[3], ST7735_BLACK);
	//Draw Min
	ST7735_Draw4Lines(pinX, pinY, pinX+(int)mnX, pinY -(int)mnY, ST7735_BLUE);
	//Erase Hour
	ST7735_Draw4Lines(pinX, pinY, pinX+(int)prevPlot[0], pinY-(int)prevPlot[1], ST7735_BLACK);
	//Draw Hour
	ST7735_Draw4Lines(pinX, pinY, pinX+(int)hrX, pinY -(int)hrY, ST7735_RED);
	//Draw Pin
	ST7735_DrawFatPin(pinX, pinY, ST7735_CYAN);
	

	//update previous angles
	prevAng[1]=hrAng;
	prevAng[0]=minAng;
	prevPlot[0]=hrX;
	prevPlot[1]=hrY;
	prevPlot[2]=mnX;
	prevPlot[3]=mnY;
	prevPlot[4]=scX;
	prevPlot[5]=scY;
	
}


